import React from 'react';
import { Card, WingBlank, WhiteSpace,List} from 'antd-mobile';
// import {Link}from'react-router-dom'
import banner from '@/assets/img/home-banner.png'
import {infoListMatch} from '@/plugins/resurceStatus/infoList'
const Item = List.Item;
const Brief = Item.Brief;

class HomePage extends React.Component {
  constructor(...args) {
    super(...args);
    this.state={
      ...infoListMatch('0')
    }
  }
  render() {
    console.log(this.state)
    return (
      <div className="qm-fill-width" style={{backgroundColor:"#f5f5f9"}}>
    <WingBlank size="lg">
    <WhiteSpace size="lg" />
    <Card><img src={banner}></img></Card>
    <WhiteSpace size="lg" />
    <List>
        <Item
          arrow="horizontal"
          thumb={this.state.icon}
          multipleLine
          onClick={() => {}}
        >
          {this.state.title} <Brief>{this.state.text}</Brief>
        </Item>
      </List>
      <WhiteSpace size="lg" />
      {['1','2','3']}
      <div>
      <List>
        <Item
          extra="10:30"
          arrow="horizontal"
          thumb="https://zos.alipayobjects.com/rmsportal/dNuvNrtqUztHCwM.png"
          multipleLine
          onClick={() => {}}
        >
          Title <Brief>subtitle</Brief>
        </Item>
      </List>
      </div>
      <WhiteSpace size="lg" />



    <WhiteSpace size="lg" />
  </WingBlank>
      </div>
    );
  }
}

export default HomePage;
